import React from 'react';
import PropTypes from 'prop-types';
import 'antd/dist/antd.css';

const TwitTwit = ({ Component }) => {
  return (
    <Component />
  );
};

TwitTwit.propTypes = {
  Component: PropTypes.elementType.isRequired,
};

export default TwitTwit;
